  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编号',
  `AlarmType` int(16) NOT NULL DEFAULT 0 COMMENT '报警类型',
  `AlarmDetail` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '报警详情',
