-- ----------------------------
-- Table structure for alarmdevicewarning
-- ----------------------------
DROP TABLE IF EXISTS `alarmdevicewarning`;
CREATE TABLE `alarmdevicewarning`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编号',
  `AlarmMajorType` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '预警类型，包括：防盗预警、运行状态预警',
  `AlarmMinorType` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '预警子类型，包括：非法开门、水表信号、电压不稳、电流过载',
  `AlarmDetail` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '报警详情',
  `AlarmTime` datetime(0) NULL DEFAULT NULL COMMENT '报警时间',
  `HandleState` int(1) NOT NULL DEFAULT 0 COMMENT '处理状态，0：未处理；1：已处理',
  `Note` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '设备故障表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for alarmpolicy
-- ----------------------------
DROP TABLE IF EXISTS `alarmpolicy`;
CREATE TABLE `alarmpolicy`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `PolicyName` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '告警策略名称',
  `WaterUseFlag` int(4) NOT NULL DEFAULT 0 COMMENT '用水量告警控制开关，0：不启用；1：启用',
  `WaterUseThreshold` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '用水量每月阈值（单位立方米）',
  `WaterUseMaxTimes` int(4) NOT NULL DEFAULT 0 COMMENT '用水量告警每日最大次数，以免重复告警',
  `EmailFlag` int(4) NOT NULL DEFAULT 0 COMMENT '邮件告警开关，0：不启用；1：启用',
  `ReceiveEmail` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '接收告警信息邮箱，多个邮箱以;分隔',
  `CreateTime` datetime(0) NULL DEFAULT NULL COMMENT '策略创建时间',
  `EditTime` datetime(0) NULL DEFAULT NULL COMMENT '策略修改时间',
  `Remark` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '策略备注',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '告警策略表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for alarmpolicyassign
-- ----------------------------
DROP TABLE IF EXISTS `alarmpolicyassign`;
CREATE TABLE `alarmpolicyassign`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `AreaId` int(3) NOT NULL COMMENT '行政区域标识',
  `PolicyId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '策略标识',
  `CreateTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`Id`) USING BTREE,
  INDEX `areaid`(`AreaId`) USING BTREE,
  CONSTRAINT `areaid` FOREIGN KEY (`AreaId`) REFERENCES `sysarea2` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '告警策略分配表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for alarmwateruse
-- ----------------------------
DROP TABLE IF EXISTS `alarmwateruse`;
CREATE TABLE `alarmwateruse`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编号',
  `UseAlarm` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '告警用水量（单位立方米）',
  `UseThreshold` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '阈值用水量（单位立方米）',
  `AlarmYear` int(11) NOT NULL DEFAULT 0 COMMENT '报警年',
  `AlarmMonth` int(11) NOT NULL DEFAULT 0 COMMENT '报警月',
  `AlarmDay` int(11) NOT NULL DEFAULT 0 COMMENT '报警日',
  `AlarmTime` datetime(0) NULL DEFAULT NULL COMMENT '报警时间',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用水量告警表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for basecardinfo
-- ----------------------------
DROP TABLE IF EXISTS `basecardinfo`;
CREATE TABLE `basecardinfo`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `DeviceId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井设备Id，描述该卡所属机井设备',
  `CardSerialNo` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '卡32位序列号',
  `CardType` int(1) NOT NULL DEFAULT 0 COMMENT '卡类型，1：用户卡；2：管理卡；3：反写卡',
  `CardCode` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '卡号',
  `OwnerName` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '持卡人姓名',
  `OwnerTelphone` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '持卡人电话',
  `UseWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '最新用水量，单位Kg',
  `TotalWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计用水量，单位Kg',
  `UsePower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '最新用电量，单位度',
  `TotalPower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计用电量，单位度',
  `UseMoney` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '本次消费金额，单位分',
  `TotalMoney` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计消费金额，单位分',
  `RemainWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '剩余水量，单位吨',
  `RemainMoney` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '剩余金额，单位分',
  `ExecutePrice` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '执行水价',
  `OpenPumpTime` datetime(0) NULL DEFAULT NULL COMMENT '开泵时间',
  `CollectTime` datetime(0) NULL DEFAULT NULL COMMENT '采集时间',
  `CreateTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `EditTime` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '水卡基础信息表' ROW_FORMAT = Dynamic;

