-- ----------------------------
-- Table structure for basedevicedynamicinfo
-- ----------------------------
DROP TABLE IF EXISTS `basedevicedynamicinfo`;
CREATE TABLE `basedevicedynamicinfo`  (
  `DeviceId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备标识，guid',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编码',
  `CardCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '卡号',
  `CollectTime` datetime(0) NULL DEFAULT NULL COMMENT '设采集时间',
  `OfflineTime` datetime(0) NULL DEFAULT NULL COMMENT '离线时间',
  `NetState` int(1) NOT NULL DEFAULT 0 COMMENT '网络状态，0：离线；1：在线',
  `NetType` int(2) NOT NULL DEFAULT 0 COMMENT '网络类型，如1：CDMA，2：FDD-LTE',
  `DoorState` int(1) NOT NULL DEFAULT 0 COMMENT '箱门状态，0：关闭；1：开启',
  `PumpState` int(1) NOT NULL DEFAULT 0 COMMENT '水泵状态，0：关闭；1：开启',
  `CardState` int(1) NOT NULL DEFAULT 0 COMMENT '上卡状态，0：下卡；1：上卡',
  `WaterpipeLevelState` int(1) NOT NULL DEFAULT 0 COMMENT '出水管液位,0 表示满，1表示低',
  `ElectricValveOpenState` int(1) NOT NULL DEFAULT 0 COMMENT '电动阀开到位,0 表示正常开动位，1表示异常',
  `ElectricValveCloseState` int(1) NOT NULL DEFAULT 0 COMMENT '电动阀关到位,0 表示正常关到位，1表示异常',
  `VacuumPumpWaterLevelState` int(1) NOT NULL DEFAULT 0 COMMENT '真空泵水位,0 表示正常，1表示低',
  `VacuumPumpState` int(1) NOT NULL DEFAULT 0 COMMENT '真空泵状态,0 表示正常，1表示低',
  `InfraredState` int(1) NOT NULL DEFAULT 0 COMMENT '红外线,0 表示正常，1表示有人',
  `AlarmState` int(1) NOT NULL DEFAULT 0 COMMENT '报警状态，0：无报警；1：有报警',
  `AlarmType` int(16) NOT NULL DEFAULT 0 COMMENT '报警类型',
  `UseWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '最新用水量，单位Kg',
  `UsePower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '最新用电量，单位度',
  `UseMoney` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '最新使用金额',
  `RemainWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '剩余用水',
  `RemainMoney` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '剩余金额',
  `TotalWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计用水量，单位Kg',
  `TotalPower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计用电量，单位度',
  `InstantFlow` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '瞬时流量，立方米/秒（m3/s）',
  `TotalFlow` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '累计流量，立方米/秒（m3/s）',
  `InstantSpeed` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '瞬时流速，米/秒（m/s）',
  `APhaseCurrent` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'A相电流，单位A',
  `BPhaseCurrent` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'B相电流，单位A',
  `CPhaseCurrent` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'C相电流，单位A',
  `APhaseVoltage` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'A相电压，单位V',
  `BPhaseVoltage` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'B相电压，单位V',
  `CPhaseVoltage` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'C相电压，单位V',
  `APhasePower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'A相运行功率，单位W',
  `BPhasePower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'B相运行功率，单位W',
  `CPhasePower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT 'C相运行功率，单位W',
  `ADCOne` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT 'ADC1，水压1，单位帕',
  `ADCTwo` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT 'ADC2，水压2，单位帕',
  `ADCThree` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT 'ADC3，水位，单位米',
  `ADCFour` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT 'ADC4，EC，单位ms/cm',
  `WaterLevel` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT '水位，单位cm',
  `Pressure` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT '压力',
  `Temperature` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT '温度',
  `Humidity` decimal(32, 2) NOT NULL DEFAULT 0.00 COMMENT '湿度',
  PRIMARY KEY (`DeviceId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '实时数据表' ROW_FORMAT = Dynamic;

