-- ----------------------------
-- Table structure for basedeviceexpandinfo
-- ----------------------------
DROP TABLE IF EXISTS `basedeviceexpandinfo`;
CREATE TABLE `basedeviceexpandinfo`  (
  `DeviceId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备标识，guid',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编号',
  `DevicePlate` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井号牌',
  `PipeDiameter` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '管道口径',
  `WellDiameter` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '井管内径',
  `PumpMaterial` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '泵管材质',
  `MakeTime` datetime(0) NULL DEFAULT NULL COMMENT '成井时间',
  `WellDepth` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '井深，单位m',
  `GroundWaterDepth` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '地下水埋深，单位m',
  `UseWaterType` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '取水类型，下拉选择',
  `WaterPumpNo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水泵型号',
  `RatedHead` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '水泵额定扬程',
  `RatedFlow` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '水泵额定流量',
  `RatedPower` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '水泵额定功率',
  `ApplyStatus` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '应用状况',
  `WellUse` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水井用途分类',
  `IrrigationMode` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '灌溉模式',
  `KZArea` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '控制面积',
  `SJArea` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '实际灌溉面积，单位亩',
  `SJSupplyWaterPeople` int(8) NOT NULL DEFAULT 0 COMMENT '实际供水人口',
  `IsHandleDocument` int(1) NOT NULL DEFAULT 0 COMMENT '是否办理取水许可证',
  `WaterIntakeNo` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '取水许可证编号',
  `YearWaterSum` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '年许可取水',
  `IsIndustryProcedure` int(1) NOT NULL DEFAULT 0 COMMENT '是否办理工业取水手续',
  `IndustryApprovedWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '年核定水量，单位m3',
  `IndustryProductionCapacity` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '生产规模，单位万元',
  `IndustryArea` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '工业区面积，单位亩',
  `WaterMeterMeasurement` int(1) NOT NULL DEFAULT 0 COMMENT '是否安装水量计量设施',
  `WaterMeterMeasurementType` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水量计量设施类型',
  `MeterType` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水表型号',
  `MeterCaliber` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '水表口径',
  `MeterSerialNo` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水表编号',
  `MeterGuard` int(1) NOT NULL DEFAULT 0 COMMENT '有无水表防护罩',
  `LandformType` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '所在地貌类型区',
  `WaterArea` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '水资源区域',
  `IrrigationAreaType` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '所在灌区类型',
  `Note` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`DeviceId`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '设备参数表' ROW_FORMAT = Dynamic;

