-- ----------------------------
-- Table structure for basedeviceinfo
-- ----------------------------
DROP TABLE IF EXISTS `basedeviceinfo`;
CREATE TABLE `basedeviceinfo`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备标识，guid',
  `AreaId` int(5) NOT NULL DEFAULT 1 COMMENT '行政区域标识',
  `WaterAreaId` int(5) NOT NULL DEFAULT 1 COMMENT '水管区域标识',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井设备编码，唯一索引',
  `DeviceAreaCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井行政码',
  `DeviceWaterAreaCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井水管码',
  `DeviceNo` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备号',
  `DeviceName` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '机井设备名称',
  `DeviceModel` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备型号',
  `SimCard` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机卡号',
  `SimOperator` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机卡运营商',
  `InstallAddress` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '安装地点',
  `InstallTime` datetime(0) NULL DEFAULT NULL COMMENT '安装时间',
  `MonitorArea` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '监测区域',
  `Longitude` decimal(18, 10) NOT NULL DEFAULT 0.0000000000 COMMENT '经度',
  `Latitude` decimal(18, 10) NOT NULL DEFAULT 0.0000000000 COMMENT '纬度',
  `IpPort` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最近一次登录的Ip:Port',
  `Imei` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'IMEI标识',
  `AllowWater` decimal(16, 2) NOT NULL DEFAULT 0.00 COMMENT '可配水量，单位Kg',
  `OwnerName` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '业主姓名',
  `OwnerTelphone` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '业主电话',
  `DTUNo` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'DTU号码',
  `PhotoBefore` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '安装前现场照片',
  `PhotoAfter` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '安装后现场照片',
  `DeviceVersion` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备版本',
  `DeviceType` int(1) NOT NULL DEFAULT 0 COMMENT '设备类型，1：金讯润泽；2：青岛恒泽',
  `CreateTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
