  PRIMARY KEY (`Id`) USING BTREE,
  INDEX `AreaId`(`AreaId`) USING BTREE,
  INDEX `WaterAreaId`(`WaterAreaId`) USING BTREE,
  INDEX `DeviceCode`(`DeviceCode`) USING BTREE,
  CONSTRAINT `basedeviceinfo_ibfk_1` FOREIGN KEY (`AreaId`) REFERENCES `sysarea2` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `basedeviceinfo_ibfk_2` FOREIGN KEY (`WaterAreaId`) REFERENCES `syswaterarea2` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '机井设备信息表' ROW_FORMAT = Dynamic;

