-- ----------------------------
-- Table structure for basedevicetask
-- ----------------------------
DROP TABLE IF EXISTS `basedevicetask`;
CREATE TABLE `basedevicetask`  (
  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `DeviceCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '设备编码',
  `CmdCode` char(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '任务命令编码',
  `CreateTime` int(11) NOT NULL DEFAULT 0 COMMENT '任务创建时间，UNIX时间戳格式',
  `ExpireTime` int(11) NOT NULL DEFAULT 0 COMMENT '任务超时失效时间',
  `IssueTime` int(11) NOT NULL DEFAULT 0 COMMENT '任务延时发布时间，如为0，则表示需要立即发布',
  `SendTime` int(11) NOT NULL DEFAULT 0 COMMENT '任务实际发送到设备时间',
  `CompleteTime` int(11) NOT NULL DEFAULT 0 COMMENT '任务执行完成时间，设备执行任务完成之后上报到服务端',
  `SendContent` varchar(4096) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '发送内容',
  `ResultOriginal` varchar(8192) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '执行结果-原始',
