  `Id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标识，guid',
  `AreaId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '所属行政区域ID',
  `WaterAreaId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '所说水管区域ID',
  `UserCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户编码',
  `UserName` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户名称',
  `UserPassword` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户密码3次MD5大写',
  `ParentUserCode` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '所属用户编码，如为“”，则是超级管理员用户',
  `RoleCode` int(2) NOT NULL COMMENT '角色代码',
  `FullName` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户姓名',
  `Mobile` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `Email` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'E-mail',
  `Address` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '地址',
  `CreateTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `EditTime` datetime(0) NULL DEFAULT NULL COMMENT '上次修改时间',
  `UserPasswordming` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '明文密码',
  `Authority` int(2) NULL DEFAULT 0 COMMENT '售水权限 0. 无售水权限 1. 有售水权限',
  `IsActive` int(2) NOT NULL COMMENT '是否激活',
  `IsAppUser` int(2) NULL DEFAULT 0 COMMENT '是否APP注册用户 0. 非APP注册  1. APP注册',
  `MobileID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'APP注册时所使用的手机标识ID',
  `AuditFlag` int(2) NULL DEFAULT 0 COMMENT '审核标志 0. 未审核  1. 审核通过  2. 审核不通过',
  `Remark` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `Token` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'token',
  PRIMARY KEY (`Id`) USING BTREE,
  INDEX `role`(`RoleCode`) USING BTREE,
  CONSTRAINT `role` FOREIGN KEY (`RoleCode`) REFERENCES `sysrole` (`RoleCode`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户表' ROW_FORMAT = Dynamic;

