-- ----------------------------
-- Procedure structure for prSaveRtData
-- ----------------------------
DROP PROCEDURE IF EXISTS `prSaveRtData`;
delimiter ;;
CREATE PROCEDURE `prSaveRtData`(IN `_UpdateStated` int,IN `_CezhanID` varchar(20),IN `_UserNo` int,IN `_UseWt` float,IN `_LeftWt` float,IN `_CurWtBase` float,IN `_OpenState` int,IN `_DoolState` int,IN `_NetState` int,IN `_Ai0` int,IN `_Ai1` int,IN `_Ai2` int,IN `_Ai3` int,IN `_Ai4` int,IN `_UsePower` float,IN `_Av` float,IN `_Bv` float,IN `_Cv` float,IN `_Aa` float,IN `_Ba` float,IN `_Ca` float,IN `_AsState` int,IN `_BsState` int,IN `_CsState` int)
BEGIN
IF _UpdateStated = 0 THEN
	UPDATE WellRtData
INNER JOIN WellInfo ON WellRtData.WellID = WellInfo.WellID
SET UserNo = _UserNo,
 CollectTime = now(),
 UseWt = _UseWt,
 LeftWt = _LeftWt,
 CurWtBase = _CurWtBase,
 OpenState = _OpenState,
 DoolState = _DoolState,
 NetState = _NetState,
 Ai0 = _Ai0,
 Ai1 = _Ai1,
 Ai2 = _Ai2,
 Ai3 = _Ai3,
 Ai4 = _Ai4,
 UsePower = _UsePower,
 AV = _Av,
 BV = _Bv,
 CV = _Cv,
 AA = _Aa,
 BA = _Ba,
 CA = _Ca,
 AState = _AsState,
 BState = _BsState,
 CState = _BsState
WHERE
	CezhanID = _CezhanID;


ELSE
	UPDATE WellRtData
INNER JOIN WellInfo ON WellRtData.WellID = WellInfo.WellID
SET NetState = _NetState
WHERE
	CezhanID = _CezhanID;


END
IF;


END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
